1f411863ad","type":"BasicTicker"}},"id":"0f64223e-582b-4083-99da-4b84a3de4b1b","type":"Grid"},{"attributes":{"text":"<p><b><font size=\"4\"><font color='blue'>Collision Cross Sections of monosaccharides </font></font></b></p>\n                        <p><font size=\"2\"><b>Title</b>: A Careful Consideration of the Influence of Structure, Partial charges \n                        and Basis Sets on Collision Cross Sections of Monosaccharides when Comparing Values \n                        from DFT calculations to those Obtained Experimentally</p> \n                        <p><b>Authors</b>: Lukasz G. Migas, Christopher J. Gray, Sabine L. Flitsch and Perdita E. Barran</p>\n                        <p><b>DOI</b>: - not available yet</p>\n                        <p>Here we show the collision cross sections (CCS) for each charge scheme \n                        (Mulliken, APT, MK, CHelpG, HLY and NPA) computed using MOBCAL (in nitrogen buffer gas) \n                        with partial charges computed combination of functionals HF (<b>a</b>), B3LYP (<b>b</b>) and M05 (<b>c</b>)\n                        and basis sets \n                        STO-3G (<b><font color='#000080'>blue</font></b>), \n                        3-21G (<b><font color='#FF0080'>magenta</font></b>),\n                        6-31G (<b><font color='#008000'>green</font></b>), \n                        6-31+G (<b><font color='#FF8000'>orange</font></b>) \n                        and 6-31G* (<b><font color='#8009FF'>purple</font></b>).</p> \n                        <p><b>Interactive tools:</b></p>\n                        <p><b><font color='green'>Hover</b></font>  - hover over any data point and it will bring detailed \n                        information about CCS, standard error, atom ID</p>\n                        <p><b><font color='green'>Zoom</b></font> - drag on the plot to zoom on specific region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"9b143d41-68d3-428d-add5-5c3f422a7f73","type":"Div"},{"attributes":{"callback":null,"end":1.05,"start":-1.5},"id":"60b2127c-d547-4db8-88ac-6542a97edc4b","type":"Range1d"},{"attributes":{"background_fill_color":{"value":"#DCDCDC"},"click_policy":"hide","items":[{"id":"0536d4d1-fde5-4cc4-8024-b4d80b785677","type":"LegendItem"},{"id":"8ecb78fc-471a-4919-8b86-1511beb41e62","type":"LegendItem"},{"id":"1bf380a3-8fd7-4db4-87da-b0142336b004","type":"LegendItem"},{"id":"197cbe22-d5b7-4c08-8110-7b220c1dd17f","type":"LegendItem"},{"id":"ec96fe5c-5e63-408d-bf6a-109b12b58f09","type":"LegendItem"}],"location":"bottom_center","orientation":"horizontal","plot":{"id":"0208b472-5fe6-4746-b807-5396da71ee24","subtype":"Figure","type":"Plot"}},"id":"ece7ab8a-af46-49a5-b94f-281dcddbabef","type":"Legend"},{"attributes":{"below":[{"id":"e8e4bb7c-2eed-4c10-a978-5a5ed3da8b3d","type":"LinearAxis"}],"left":[{"id":"42529621-7c7e-44bf-ac65-cee0cffb7327","type":"LinearAxis"}],"plot_height":300,"plot_width":800,"renderers":[{"id":"e8e4bb7c-2eed-4c10-a978-5a5ed3da8b3d","type":"LinearAxis"},{"id":"3ee28dad-d9b3-4cd1-b7cb-b81afb212225","type":"Grid"},{"id":"42529621-7c7e-44bf-ac65-cee0cffb7327","type":"LinearAxis"},{"id":"f4582f35-eb30-4710-8770-e1c46f061aad","type":"Grid"},{"id":"cff31b89-74ce-4d9a-b57d-abb555870023","type":"BoxAnnotation"},{"id":"a14e3ca7-939a-4cba-89db-a348bc0e705f","type":"Legend"},{"id":"d440c298-298e-41b4-bd08-efad826db3f3","type":"GlyphRenderer"},{"id":"e13e2b03-50e4-43de-bbd8-5f9e45ca6144","type":"GlyphRenderer"},{"id":"f05ecbd4-0b5d-4ded-9dfc-096620d03fc0","type":"GlyphRenderer"},{"id":"fd8728d6-fa7c-49a1-afec-5a452039cde2","type":"GlyphRenderer"},{"id":"8b16e602-8621-41c5-ac9e-f4d1c3efef57","type":"GlyphRenderer"},{"id":"f8a4a54d-d5bf-4630-a67d-cbd76467702a","type":"GlyphRenderer"},{"id":"e6c26cf5-c1c9-4928-a6ca-abb7acd7349a","type":"GlyphRenderer"},{"id":"d6b13f8e-b6c3-41a2-8d77-f61ad9de25bd","type":"GlyphRendere  size=\"2\"><b>Title</b>: A Careful Consideration of the Influence of Structure, Partial charges \n                        and Basis Sets on Collision Cross Sections of Monosaccharides when Comparing Values \n                        from DFT calculations to those Obtained Experimentally</p> \n                        <p><b>Authors</b>: Lukasz G. Migas, Christopher J. Gray, Sabine L. Flitsch and Perdita E. Barran</p>\n                        <p><b>DOI</b>: - not available yet</p>\n                        <p>Here we show the average partial atomic charges for each charge scheme \n                        (Mulliken, APT, MK, CHelpG, HLY and NPA) computed using MOBCAL (in nitrogen buffer gas) \n                        with partial charges computed combination of functionals HF (<b>a</b>), B3LYP (<b>b</b>) and M05 (<b>c</b>)\n                        and basis sets \n                        STO-3G (<b><font color='#000080'>blue</font></b>), \n                        3-21G (<b><font color='#FF0080'>magenta</font></b>),\n                        6-31G (<b><font color='#008000'>green</font></b>), \n                        6-31+G (<b><font color='#FF8000'>orange</font></b>) \n                        and 6-31G* (<b><font color='#8009FF'>purple</font></b>).</p> \n                        <p><b>Interactive tools:</b></p>\n                        <p><b><font color='green'>Hover</b></font>  - hover over any data point and it will bring detailed information \n                        about partial atomic charge, standard error, atom ID</p>\n                        <p><b><font color='green'>Zoom</b></font> - drag on the plot to zoom on specific region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"29909a2e-d954-47cd-8ae9-200a84594d3a","type":"Div"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"line_alpha":{"value":0.1},"line_color":{"value":"#1    <p><b>DOI</b>: - not available yet</p>\n                        <p>Here we show the collision cross sections (CCS) for each charge scheme \n                        (Mulliken, APT, MK, CHelpG, HLY and NPA) computed using MOBCAL (in nitrogen buffer gas) \n                        with partial charges computed combination of functionals HF (<b>a</b>), B3LYP (<b>b</b>) and M05 (<b>c</b>)\n                        and basis sets \n                        STO-3G (<b><font color='#000080'>blue</font></b>), \n                        3-21G (<b><font color='#FF0080'>magenta</font></b>),\n                        6-31G (<b><font color='#008000'>green</font></b>), \n                        6-31+G (<b><font color='#FF8000'>orange</font></b>) \n                        and 6-31G* (<b><font color='#8009FF'>purple</font></b>).</p> \n                        <p><b>Interactive tools:</b></p>\n                        <p><b><font color='green'>Hover</b></font>  - hover over any data point and it will bring detailed \n                        information about partial atomic charge, standard error, atom ID</p>\n                        <p><b><font color='green'>Zoom</b></font> - drag on the plot to zoom on specific region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"b033f68a-31cf-4602-9706-4cff717aa050","type":"Div"},{"attributes":{"data_source":{"id":"a6dd1ca2-a778-46d5-a0a2-cfc8c453d309","type":"ColumnDataSource"},"glyph":{"id":"b8fec762-62a1-40a4-ae60-f69c9ad8f55d","type":"Square"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"5bbe2af0-a0f5-4119-bc92-b2e6a04bc9e7","type":"Square"},"selection_glyph":null},"id":"1f57e12c-4a84-46f5-b5c2-6e6257db3b67","type":"GlyphRenderer"},{"attributes":{"children":[{"id":"4e72cef2-b460-40be-a4bc-01b6d0d68289","subtype":"Figure","type":"Plot"},{"id":"b90066c9-e9e0-412b-a51c-2a2065a3893c","subtype":"Figure","type":"Plot"}
